const Button = ({city, handleClick}, target) => {
  return (
  <button onClick={handleClick} style={{ margin: "0 10px", width: "100px", height: "40px", backgroundColor: target[0] == true ? "red" : "blue"}}>{city}</button>
  )
}

export default Button;
